INSERT INTO `places` VALUES ('02d9a2b5-7dca-423f-8406-707bc76abf7e','2017-03-25 02:17:06','2017-03-25 02:17:06','1721b75c-e0b2-46ae-8dd2-f86b62fb46e6','3ea61b06-e22a-459b-bb96-d900fb8f843a','The Lynn House','Our place is 2 blocks from Vista Park (Farmer\'s Market), Historic Warren Ballpark, and about 2 miles from Old Bisbee where there is shopping, dining, and site seeing. We offer continental breakfast. You get the quiet life with great mountain and garden views. This is a 100+ year old cozy home which has been on both the Garden and Home tours. You have access to whole house, except for 1 restricted area (She-Shack).  Hosts are on site in a casita in the back from 8pm until 7am when we are in town.<BR /><BR />Our home has two bedrooms, one king and one queen.  There are 2 bathrooms, 1  1950\'s soak tub with shower and 1 with shower only.  Guests have access to the living/dining room area, and the kitchen (except for use of stove/oven).  Each morning, coffee/tea, and muffins are ready for guests.  A small frig is available in the dining room with water/juice and an area for guest items.  1 parking space is directly across the street.  There is a large back patio with a grill for guests to u',2,2,4,82,31.4141,-109.879),('0675a2d6-f64c-4be7-9a8a-f55341f09d4b','2017-03-25 02:17:06','2017-03-25 02:17:06','4a0c57bb-60da-450c-afcf-c59be4c05e67','3fda0d5c-fea4-4920-bc91-6e6c6663d161','Cozy, Bright Studio in GOLD COAST w/Rooftop','This lovely, sunny studio is in the beautiful Gold Coast neighborhood of downtown Chicago. Bars, restaurants, parks, shopping and public transport are within walking distance. Steps away from the Loop. Prime nearby attractions include Lake Michigan, Oak Street Beach, Lincoln Park, Museum of Contemporary Art and the Lyric Opera. Rush Street, which offers great dinning, shopping and entertainment, is a short block away.<BR /><BR />Apartment has shared rooftop with beautiful views of Chicago\'s skyline.<BR /><BR />This 250 sq. ft. studio is cozy, warm, and with lots of light. The small kitchen has a stove, a microwave, a toaster, and an espresso machine loaded with good coffee. Our apartment has a queen-sized mattress, and two-person sofa: altogether they can accommodate three persons. Plenty of closet space.<BR /><BR />You will have an access to a shared rooftop, and a laundry room. Free street parking is available very close to the building on LaSalle Street (except 4PM - 6:30 PM on week',0,1,2,65,41.9009,-87.6298),('073084e1-1d9d-49e6-8383-42ef6f4325b5','2017-03-25 02:17:06','2017-03-25 02:17:06','f3923bdf-81f2-45e9-a5e1-fd128e122d45','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','Fairpark. Downtown Tupelo','A private bedroom with a queen size bed and private bathroom is available in my 3 bedroom home in Tupelo\'s Downtown Fairpark. Access to Living area, laundry and kitchen included. One block from downtown shopping, restaurants, BancorpSouth Arena and the Farmer\'s Market. This is a friendly and quiet neighborhood. There are 2 bedrooms available for up to 4 guests.<BR /><BR />Parking is available at house. One block from downtown tupelo, Lots of restaurants, shopping and entertainment within 1 block of house.',1,1,2,54,34.2546,-88.7022),('09b4888f-0e06-4ab1-abbc-05e9865634d0','2017-03-25 02:17:06','2017-03-25 02:17:06','e4e40a6e-59ff-4b4f-ab72-d6d100201588','00e93fc3-53ff-4da4-8e72-faa5216f81bb','Spanish Town Historic District, Heart of Downtown','Our home is a block away from parks, art and culture, including several museums and the Capitol district,  and restaurants and bars within walking distance. Very safe, quiet, in the bustle of downtown but the privacy of a neighborhood. The location, the people, and the ambiance of our funky neighborhood, Spanish Town, make this a perfect spot when visiting. My place is perfect for couples, solo adventurers, business travelers, and pets.',1,1,2,65,30.4557,-91.1827),('0a454f9a-eaac-488b-8443-23cf58f7ae37','2017-03-25 02:17:06','2017-03-25 02:17:06','5e061866-d4ad-4aa7-befe-2bf5f8698e29','f9b11370-f316-492c-92da-014d7bce7213','Beautiful, Bungalow steps to Beach!','Looking for a cozy, beach house? Well this is it!<BR />Steps from the most beautiful beachs.<BR />Shared home with 2 cool roommates.<BR />Comfy corner bedroom with a full bed & amazing sea breezes.<BR />Cable, WiFi, plenty of yard for parking a car or hanging out!<BR />House is 30 minutes by car from airport, Honolulu & Waikiki.<BR />It\'s BEST to rent a car if staying here, especially if you don\'t want to spend a large amount of your time getting places.<BR /><BR />The house has a great vibe that invites you in to hangout.<BR />It\'s a 3 bedroom 1 bath home.<BR />Steps from Kailua beach.<BR />Two people currently live in the house but are not always home. <BR />Very friendly, Ohana style.<BR />Kitchen to make coffee & very light food prep & living room  are available for your use.<BR />Make yourself at home. <BR />There is TV, Cable, Wifi.<BR />Small workout area outside if you like to lift weights.<BR />Large yard for hanging out also.<BR /><BR />Rented room, family room, kitchen, bath',1,1,2,79,21.4088,-157.745),('0b96262f-2c72-464c-a182-8f58afde4288','2017-03-25 02:17:06','2017-03-25 02:17:06','45903748-fa39-4cd0-8a0b-c62bfe471702','b6160096-c503-4909-a674-7bfbddc8cc45','Freetown Artist Loft','The Freetown Artist Studio is situated  in the heart of  Downtown Lafayette and is only a few blocks from live music and great food. Living space is approximately 1000 square feet and comes with all of the amenities for a creative, relaxing getaway.<BR /><BR />The apartment measures 1000 square feet and has been newly renovated.  I\'m using this space strictly for airbnb. There are a total of 5 rooms, a dining room/utility room has table and chairs, serving utensils and artwork with folding doors hide the washing machine and dryer. The kitchen is complete with refrigerator, cast iron sink, dishwasher, cooking utensils  and gas stove. The bathroom has a cast iron tub/shower, toilet sink, towels and toiletries. The living room has a large picture window overlooking a pond, a sleeper sofa, media armoire, bookshelves, table and chairs and secretary. The bedroom has a queen size bed, chest of drawers, ceiling fan and closet. The apartment has many pieces of original art and small, private ba',1,1,4,100,30.2216,-92.0143),('0d10682b-5bd4-4fde-9427-0067fe6ff63c','2017-03-25 02:17:06','2017-03-25 02:17:06','f14fefb3-c6e4-42f6-8a5a-ee704a101f8b','00e93fc3-53ff-4da4-8e72-faa5216f81bb','Large, sunny room','This is a large room on the second floor of a 1925 two-story house. With 5 large windows, it faces southwest and gets a lot of afternoon sun; the room has an air-conditioning unit in the summer, though the house itself is not air-conditioned. There is a queen-sized bed and a single bed in the room, and there is also a table and chair and lamp for lap-top work. The bathroom has a shower and is usually shared with other guests.<BR /><BR />This is a larger older house (1925) in a residential neighborhood on Red Mountain. The house has two living rooms that are fairly large and a front and back porch, a fairly big kitchen and a back room with a washer and dryer.<BR /><BR />Guests are welcome to use the living rooms. They are welcome as well to use the kitchen (and washing machine for longer stays), but we would appreciate it if you would let us know in advance your wishes for using the kitchen so we can coordinate.<BR /><BR />We will be around the house during guest stays, and we are glad ',1,1,3,36,33.4884,-86.8079),('0feb3595-1c64-4bad-816c-769446217d4f','2017-03-25 02:17:06','2017-03-25 02:17:06','14e49d0b-7363-40e3-8854-a89e96481f67','c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e','Sugar Creek Hills','My place is close to Chicagoland speedway, public transport. Youll love my place because of the comfy bed and the coziness. My place is good for couples, business travelers, families (with kids), and furry friends (pets).Broker owned. no garage or basement use.can go month to month or year lease.<BR /><BR />Walk around the pond nearby or trail for exercise or just fresh air.<BR /><BR />entire home and yard<BR /><BR />Available by phone<BR /><BR />near metra,major highways',2,1,4,100,41.4921,-88.069),('1014dfdf-fa7a-487c-bba8-2d3076d570dc','2017-03-25 02:17:06','2017-03-25 02:17:06','5481bd82-04ab-4a58-ae01-d67443aec20c','70b18dcc-08ef-4040-91cf-4075973d320a','Private Studio with Mini Kitchen and Sauna','Private walk-out studio off beautiful backyard with mini kitchen, sauna, jetted tub, fireplace and your own laundry facilities. In the heart of the city, we are close to bus routes, National Jewish Hospital, Rose Medical Center and Cherry Creek Shopping District. An easy three miles west to downtown.<BR /><BR />It is cozy and yet has a number of creature comforts, including a Casper mattress (No. 1 rated by Consumer Report), a great soaking tub, an indoor sauna, heated tile floor in bathroom, fireplace, and a rain shower type shower head.<BR /><BR />The space is very self-contained, with its own private entrance, laundry facilities, bathroom, kitchen, outside sitting area and more, but guests can make use of the large backyard, deck, and additional sitting area.<BR /><BR />I really enjoy interacting with people but realize each guest will have his or her own natural preferences in that regard or priorities based upon the purpose of the trip. I am able to run the gamut from remaining av',0,1,2,75,39.7362,-104.929),('10974581-bff8-4ba6-9a00-2ae42d521162','2017-03-25 02:17:06','2017-03-25 02:17:06','dacec983-cec4-4f68-bd7f-af9068a305f5','426624f6-84a9-4ec4-84f3-7655dc70e86e','SOBE Refined Studio 2 min to Beach & Ocean Drive','Enjoy South Beach in one of the best locations in my clean, quiet & remodeled studio!<BR /><BR />You\'re only 2 blocks from the beach and 1 block from fashionable retailers, restaurants, bars, convenience stores, bike rentals & parking structure! <BR /><BR />FREE WiFi!<BR /><BR />My place is close to New